CREATE DEFINER=`root`@`localhost` PROCEDURE `slqPr_Insert_Cultural_Event`(IN AID Integer,
                                                            IN CName Varchar(50),
                                                            IN CPercentage Integer,
                                                            IN CStatus Varchar(25),
                                                            IN CDate VarChar(25),
                                                            IN CType VarChar(25),
                                                            IN CSched VarChar(50),
                                                            IN CJudgeType VarChar(25))
BEGIN
      declare lastrecord integer;
      declare totalMajor integer;
      declare totalMinor integer;
      declare totalvalue1 integer;
      declare totalvalue2 integer;

      set totalMajor = (Select SUM(Cul_Percentage) from Cultural_Events where Cul_Status = 'Active' and Cul_Type = 'Major Event');
      set totalMinor = (Select SUM(Cul_Percentage) from Cultural_Events where Cul_Status = 'Active' and Cul_Type = 'Minor Event');

      set totalvalue1 = (totalMajor+CPercentage);
      set totalvalue2 = (totalMinor+CPercentage);

      set lastrecord = (SELECT OP_ID FROM Overall_Points where OP_Type = 'Cultural Event' and OP_Status = 'Active' ORDER BY OP_ID DESC LIMIT 1);

      if Exists(Select 'True' from Cultural_Events where Cul_Name = CName and Cul_Status = 'Active')then

        Select ('Event Already Exist');

      else

          if((totalvalue1 >100) AND (totalvalue2 >100))then
            Select ('This Event will contain total of More than 100% this is invalid');
          else
            Select ('Successfully Save');

            INSERT INTO Cultural_Events(Acc_ID,OP_ID,Cul_Name,Cul_Percentage,Cul_Status,Cul_Date,Cul_Type,Cul_Sched,Cul_Type_Judging)
            VALUES(AID,lastrecord,CName,CPercentage,CStatus,CDate,CType,CSched,CJudgeType);
        end if;
      end if;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `slq_Pr_Insert_Attended_CulturalEvent`(IN CName VarChar(50))
BEGIN
     Declare getparticipant Integer;
       Declare getCulturalID Integer;
       Declare getSequenceNumber Integer;
       set getparticipant = (Select Part_ID from Participants ORDER BY Part_ID DESC LIMIT 1);
       set getCulturalID = (Select Cul_ID from Cultural_Events where Cul_Name = CName and Cul_Status = 'Active');
       set getSequenceNumber = (Select count(ACE.ACE_Secnum)+1 from Attended_CulturalEvents ACE where ACE.Cul_ID = getCulturalID);


        if Exists (Select 'True' from Attended_CulturalEvents AC
                   INNER JOIN  Cultural_Events CE ON CE.Cul_ID = AC.Cul_ID)then
          Select ('This Event already assigned on this participant');
        else
          Select ('Successfully Save');
       Insert into Attended_CulturalEvents(Part_ID,Cul_ID,ACE_Secnum)
       values(getparticipant,getCulturalID,getSequenceNumber);
     end if;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Sports`(in name Varchar(60))
BEGIN
    SELECT t.Team_Name, CONCAT(p.Part_FName,' ',p.Part_MName,' ',p.Part_LName)fullname, sum(cr.S_CompScore) as total, co.SOS_TotalScore from participants p
    inner join teams t on p.Team_ID=t.Team_ID
    inner join attended_sportsevents ac on p.Part_ID = ac.Part_ID
    inner join sports_score cr on ac.Ap_ID = cr.Ap_ID
    inner join sports_overall_score co on ac.Ap_ID = co.Ap_ID
    inner join sports_events ce on ac.Sp_ID = ce.Sp_ID where ce.Sp_Name = name
    group by fullname;
END$$

